import React from 'react';

const Home = () => {
  return (
    <div>
      <h1>Welcome to E-Commerce Shop</h1>
      <p>"Welcome to our online cosmetics store!"
We are pleased to offer you a wide range of skin care, hair care and decorative cosmetics. Here you will find only high-quality products from trusted brands to highlight your beauty and give you confidence every day.

"Cosmetics created for you."
Our store is the place where your self-care story begins. We have collected a collection of products that meet the highest quality standards. Discover the world of beauty with unique offers, discounts and new products!

"Be bright, be natural!"
In our cosmetics store, everyone will find something that will emphasize their individuality. Natural compositions, trendy shades and effective formulas - we have done everything to make you feel unique. Start your journey into the world of beauty right now!</p>
    </div>
  );
};

export default Home;
